        /*--------------------------------------------------------------
        # General
        --------------------------------------------------------------*/
        body {
            font-family: "Open Sans", sans-serif !important;
            color: #444444;
        }

        a {
            text-decoration: none;
            color: #d9232d;
        }

        a:hover {
            color: #e24d55;
            text-decoration: none;
        }

        h1, h2, h3, h4, h5, h6 {
            font-family: "Raleway", sans-serif;
        }

        li{
            font-family: "Comic Sans", sans-serif;
        }

        .list-group {
            max-height: 500px;
            width: 380px;
            margin-bottom: 10px;
            overflow-x: hidden;
            overflow-y: scroll;
            -webkit-overflow-scrolling: touch;
        }
        .cntr{
            position: absolute;
            margin-top: 100px;
            font-size: 18px;
        }
        hr{margin: 40px 0% 30px 0%;}
        .hrdop {width: 68,6%; margin: 50px 16% 25px 16%;}

        .heading{
            text-align: center;
            font-size: 20pt;
            margin-bottom: 20px;
            margin-top: 5px;
        }

        .ri-check-double-line{
            color: #e24d55;
            font-size: 20px;
            padding: auto;
            margin-top: 100px;
        }
        li {
            list-style-type: none; /* Убираем маркеры */
        }
        .withoutRed{
            color: black;
        }
        .nothing{
            padding: 10px;
            background: #d9232d;
            margin-left: 30px;
            border-radius: 4px;
            font-weight: 400;
            color: white !important;
        }
        .droping{
            margin-right: 300px;
            margin-left: 30px;
        }
        .navbar ul li ul {
            padding: 10px 20px;
            font-size: 15px;
            text-transform: none;
            font-weight: 400;
        }
        nav ul li:hover > ul{
            display: inherit;
        }
        .aboutService{
            margin: 0px 16% 30px 16%;
        }
        .redborder{
            border-color: gainsboro;
            margin-right: 150px;
            border-width: 2px
        }
        .vstroky{
            display: flex;
            flex-direction: row;
        }
        .posentry{
            text-align: center;
