        /*--------------------------------------------------------------
        # Back to top button
        --------------------------------------------------------------*/
        .back-to-top {
            position: fixed;
            visibility: hidden;
            opacity: 0;
            right: 15px;
            bottom: 15px;
            z-index: 996;
            background: #d9232d;
            width: 40px;
            height: 40px;
            border-radius: 4px;
            transition: all 0.4s;
        }
        .back-to-top i {
            font-size: 28px;
            color: #fff;
            line-height: 0;
        }
        .back-to-top:hover {
            background: #e1444d;
            color: #fff;
        }
        .back-to-top.active {
            visibility: visible;
            opacity: 1;
        }

        /*--------------------------------------------------------------
        # Header
        --------------------------------------------------------------*/
        #header {
            background: white;
            transition: all 0.5s;
            z-index: 997;
            padding: 20px 0;
        }
        #header.header-scrolled {
            box-shadow: 0px 2px 15px rgba(0, 0, 0, 0.1);
            padding: 12px 0;
        }
        #header.header-inner-pages {
            box-shadow: 0px 2px 15px rgba(0, 0, 0, 0.1);
        }
        #header .logo {
            font-size: 28px;
            margin: 0;
            padding: 0;
            line-height: 1;
            font-weight: 700;
            text-transform: uppercase;
        }
        #header .logo a {
            color: #556270;
        }
        #header .logo img {
            max-height: 40px;
        }

        /*--------------------------------------------------------------
        # Navigation Menu
        --------------------------------------------------------------*/
        /**
        * Desktop Navigation
        */
        .navbar {
            padding: 0;
        }
        .navbar ul {
            margin: 0;
            padding: 0;
            display: flex;
            list-style: none;
            align-items: center;
        }
        .navbar li {
            position: relative;
            font-family: "Montserrat", sans-serif !important;
        }
        .navbar a, .navbar a:focus {
            display: flex;
            align-items: baseline;
            justify-content: space-between;
            padding: 10px 10px 10px 10px;
            font-family: "Poppins", sans-serif;
            font-size: 15px;
            font-weight: 500;
            color: #556270;
            white-space: nowrap;
            transition: 0.3s;
        }
        .navbar a i, .navbar a:focus i {
            font-size: 18px;
            line-height: 0;
            margin-left: 5px;
        }
        .navbar a:hover, .navbar .active, .navbar .active:focus, .navbar li:hover > a {
            color: #d9232d;
        }
        .navbar .getstarted, .navbar .getstarted:focus {
            background: #d9232d;
            margin-left: 30px;
            border-radius: 4px;
            font-weight: 400;
            color: #fff;
        }
        .navbar .getstarted:hover, .navbar .getstarted:focus:hover {
            color: #fff;
            background: #e1444d;
        }
        .navbar .dropdown ul {
            display: block;
            position: absolute;
            left: 14px;
            top: calc(100% + 30px);
            margin: 0;
            padding: 10px 0;
            z-index: 99;
            opacity: 0;
            visibility: hidden;
            background: #fff;
            box-shadow: 0px 0px 30px rgba(127, 137, 161, 0.25);
            transition: 0.3s;
        }
        .navbar .dropdown ul li {
            min-width: 200px;
        }
        .navbar .dropdown ul {
            padding: 10px 20px;
            font-size: 15px;
            text-transform: none;
            font-weight: 400;
        }
        /*.navbar .dropdown ul a {
          padding: 10px 20px;
          font-size: 15px;
          text-transform: none;
          font-weight: 400;
        }*/
        .navbar .dropdown ul a i {
            font-size: 12px;
        }
        .navbar .dropdown ul a:hover, .navbar .dropdown ul .active:hover, .navbar .dropdown ul li:hover > a {
            color: #d9232d;
        }
        .navbar .dropdown:hover > ul {
            opacity: 1;
            top: 100%;
            visibility: visible;
        }
        .navbar .dropdown .dropdown ul {
            top: 0;
            left: calc(100% - 30px);
            visibility: hidden;
        }
        .navbar .dropdown .dropdown:hover > ul {
            opacity: 1;
            top: 0;
            left: 80px;
            visibility: visible;
        }
        @media (max-width: 1366px) {
            .navbar .dropdown .dropdown ul {
                left: -90%;
            }
            .navbar .dropdown .dropdown:hover > ul {
                left: -100%;
            }
        }

        /**
        * Mobile Navigation
        */
        .mobile-nav-toggle {
            color: #556270;
            font-size: 28px;
            cursor: pointer;
            display: none;
            line-height: 0;
            transition: 0.5s;
        }
        .mobile-nav-toggle.bi-x {
            color: #fff;
        }

        @media (max-width: 991px) {
            .mobile-nav-toggle {
                display: block;
            }

            .navbar ul {
                display: none;
            }
        }
        .navbar-mobile {
            position: fixed;
            overflow: hidden;
            top: 0;
            right: 0;
            left: 0;
            bottom: 0;
            background: rgba(63, 73, 83, 0.9);
            transition: 0.3s;
            z-index: 999;
        }
        .navbar-mobile .mobile-nav-toggle {
            position: absolute;
            top: 15px;
            right: 15px;
        }
        .navbar-mobile ul {
            display: block;
            position: absolute;
            top: 55px;
            right: 15px;
            bottom: 15px;
            left: 15px;
            padding: 10px 0;
            background-color: #fff;
            overflow-y: auto;
            transition: 0.3s;
        }
        .navbar-mobile a, .navbar-mobile a:focus {
            padding: 10px 20px;
            font-size: 15px;
            color: #556270;
        }
        .navbar-mobile a:hover, .navbar-mobile .active, .navbar-mobile li:hover > a {
            color: #d9232d;
        }
        .navbar-mobile .getstarted, .navbar-mobile .getstarted:focus {
            margin: 15px;
        }
        .navbar-mobile .dropdown ul {
            position: static;
            display: none;
            margin: 10px 20px;
            padding: 10px 0;
            z-index: 99;
            opacity: 1;
            visibility: visible;
            background: #fff;
            box-shadow: 0px 0px 30px rgba(127, 137, 161, 0.25);
        }
        .navbar-mobile .dropdown ul li {
            min-width: 200px;
        }
        .navbar-mobile .dropdown ul a {
            padding: 10px 20px;
        }
        .navbar-mobile .dropdown ul a i {
            font-size: 12px;
        }
        .navbar-mobile .dropdown ul a:hover, .navbar-mobile .dropdown ul .active:hover, .navbar-mobile .dropdown ul li:hover > a {
            color: #d9232d;
        }
        .navbar-mobile .dropdown > .dropdown-active {
            display: block;
        }

        /*--------------------------------------------------------------
        # Hero Section
        --------------------------------------------------------------*/
        #hero {
            width: 100%;
            height: 100vh;
            background-color: rgba(63, 73, 83, 0.8);
            overflow: hidden;
            position: relative;
        }
        #hero .carousel, #hero .carousel-inner, #hero .carousel-item, #hero .carousel-item::before {
            position: absolute;
            top: 0;
            right: 0;
            left: 0;
            bottom: 0;
        }
        #hero .carousel-item {
            background-size: cover;
            background-position: center;
            background-repeat: no-repeat;
        }
        #hero .carousel-item::before {
            content: "";
            background-color: rgba(30, 35, 40, 0.6);
        }
        #hero .carousel-container {
            display: flex;
            justify-content: center;
            align-items: center;
            position: absolute;
            bottom: 0;
            top: 70px;
            left: 50px;
            right: 50px;
        }
        #hero .container {
            text-align: center;
        }
        #hero h2 {
            color: #fff;
            margin-bottom: 20px;
            font-size: 48px;
            font-weight: 700;
        }
        #hero p {
            -webkit-animation-delay: 0.4s;
            animation-delay: 0.4s;
            margin: 0 auto 30px auto;
            color: #fff;
        }
        #hero .carousel-inner .carousel-item {
            transition-property: opacity;
            background-position: center top;
        }
        #hero .carousel-inner .carousel-item,
        #hero .carousel-inner .active.carousel-item-start,
        #hero .carousel-inner .active.carousel-item-end {
            opacity: 0;
        }
        #hero .carousel-inner .active,
        #hero .carousel-inner .carousel-item-next.carousel-item-start,
        #hero .carousel-inner .carousel-item-prev.carousel-item-end {
            opacity: 1;
            transition: 0.5s;
        }
        #hero .carousel-inner .carousel-item-next,
        #hero .carousel-inner .carousel-item-prev,
        #hero .carousel-inner .active.carousel-item-start,
        #hero .carousel-inner .active.carousel-item-end {
            left: 0;
            transform: translate3d(0, 0, 0);
        }
        #hero .carousel-control-next-icon, #hero .carousel-control-prev-icon {
            background: none;
            font-size: 30px;
            line-height: 0;
            width: auto;
            height: auto;
            background: rgba(255, 255, 255, 0.2);
            border-radius: 50px;
            transition: 0.3s;
            color: rgba(255, 255, 255, 0.5);
            width: 54px;
            height: 54px;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        #hero .carousel-control-next-icon:hover, #hero .carousel-control-prev-icon:hover {
            background: rgba(255, 255, 255, 0.3);
            color: rgba(255, 255, 255, 0.8);
        }
        #hero .carousel-indicators li {
            cursor: pointer;
            background: #fff;
            overflow: hidden;
            border: 0;
            width: 12px;
            height: 12px;
            border-radius: 50px;
            opacity: 0.6;
            transition: 0.3s;
        }
        #hero .carousel-indicators li.active {
            opacity: 1;
            background: #d9232d;
        }
        #hero .btn-get-started {
            font-family: "Raleway", sans-serif;
            font-weight: 500;
            font-size: 14px;
            letter-spacing: 1px;
            display: inline-block;
            padding: 14px 32px;
            border-radius: 4px;
            transition: 0.5s;
            line-height: 1;
            color: #fff;
            -webkit-animation-delay: 0.8s;
            animation-delay: 0.8s;
            background: #d9232d;
        }
        #hero .btn-get-started:hover {
            background: #df3740;
        }
        @media (max-width: 992px) {
            #hero {
                height: 100vh;
            }
            #hero .carousel-container {
                top: 8px;
            }
        }
        @media (max-width: 768px) {
            #hero h2 {
                font-size: 28px;
            }
        }
        @media (min-width: 1024px) {
            #hero .carousel-control-prev, #hero .carousel-control-next {
                width: 5%;
            }
        }
        @media (max-height: 500px) {
            #hero {
                height: 120vh;
            }
        }

        /*--------------------------------------------------------------
        # Sections General
        --------------------------------------------------------------*/
        section {
            padding: 60px 0;
            overflow: hidden;
        }

        .section-bg, .services .icon-box {
            background-color: #f8f9fa;
        }

        .section-title {
            padding-bottom: 40px;
        }
        .section-title h2 {
            font-size: 14px;
            font-weight: 500;
            padding: 0;
            line-height: 1px;
            margin: 0 0 5px 0;
            letter-spacing: 2px;
            text-transform: uppercase;
            color: #aaaaaa;
            font-family: "Poppins", sans-serif;
        }
        .section-title h2::after {
            content: "";
            width: 120px;
            height: 1px;
            display: inline-block;
            background: #e6636a;
            margin: 4px 10px;
        }
        .section-title p {
            margin: 0;
            margin: 0;
            font-size: 36px;
            font-weight: 700;
            text-transform: uppercase;
            font-family: "Poppins", sans-serif;
            color: #556270;
        }

        /*--------------------------------------------------------------
        # Breadcrumbs
        --------------------------------------------------------------*/
        .breadcrumbs {
            padding: 18px 0;
            background: #f8f9fa;
            min-height: 40px;
            margin-top: 80px;
        }
        .breadcrumbs h2 {
            font-size: 32px;
            font-weight: 300;
            margin: 0;
        }
        .breadcrumbs ol {
            display: flex;
            flex-wrap: wrap;
            list-style: none;
            padding: 0;
            margin: 0;
            font-size: 14px;
        }
        .breadcrumbs ol li + li {
            padding-left: 10px;
        }
        .breadcrumbs ol li + li::before {
            display: inline-block;
            padding-right: 10px;
            color: #6b7b8d;
            content: "/";
        }
        @media (max-width: 992px) {
            .breadcrumbs {
                margin-top: 58px;
            }
            .breadcrumbs .d-flex {
                display: block !important;
            }
            .breadcrumbs h2 {
                margin-bottom: 10px;
            }
            .breadcrumbs ol {
                display: block;
            }
            .breadcrumbs ol li {
                display: inline-block;
            }
        }

        /*--------------------------------------------------------------
        # About
        --------------------------------------------------------------*/
        .about .content h2 {
            font-weight: 700;
            font-size: 48px;
            line-height: 60px;
            margin-bottom: 20px;
            text-transform: uppercase;
        }
        .about .content h3 {
            font-weight: 300;
            line-height: 32px;
            font-size: 24px;
        }
        .about .content ul {
            list-style: none;
            padding: 0;
        }
        .about .content ul li {
            padding: 10px 0 0 28px;
            position: relative;
        }
        .about .content ul i {
            left: 0;
            top: -90px;
            position: absolute;
            font-size: 20px;
            color: #d9232d;
        }
        .about .content p:last-child {
            margin-bottom: 0;
        }
        .shrift{
            font-size: 18px;
        }
        .redunderline{
            text-decoration: underline;
            text-decoration-color: red;
        }
        .rasilka{
            outline:none;
        }
        /*--------------------------------------------------------------
        # Clients
        --------------------------------------------------------------*/
        .clients {
            padding: 15px 0;
            text-align: center;
        }
        .clients img {
            max-width: 45%;
            transition: all 0.4s ease-in-out;
            display: inline-block;
            padding: 15px 0;
            filter: grayscale(100);
        }
        .clients img:hover {
            filter: none;
            transform: scale(1.15);
        }
        @media (max-width: 768px) {
            .clients img {
                max-width: 40%;
            }
        }

        /*--------------------------------------------------------------
        # Services
        --------------------------------------------------------------*/
        .services .icon-box {
            margin-bottom: 20px;
            padding: 30px;
            border-radius: 6px;
